# @param {String} s
# @return {String[]}
def find_repeated_dna_sequences(s)
  return [] if s.length < 10
  hash = Hash.new
  for i in 0..s.length-10 do
    current = s[i..i+9]
    hash.has_key?(current) ? hash[current] += 1 : hash[current] = 1
  end
  # binding.pry
  return hash.map{ |k,v| v >= 2 ? k : nil }.compact
end

